        <div className="App">
          <header className="App-header">
            <h1>Shopping App</h1>
            <nav>
              <ul>
                <li>
                  <a href="/">Home</a>
                </li>
                <li>
                  <a href="/about">About</a>
                </li>
                <li>
                  <a href="/cart">Cart</a>
                </li>
              </ul>
            </nav>
          </header>
          <main>
            <Switch>
              <Route exact path="/" component={Home} />
              <Route path="/about" component={About} />
              <Route path="/cart" component={Cart} />
            </Switch>
          </main>
        </div>
      </Router>
    </>
  );
}
export default App;
